import request from './request'

export function getAllPatients() {
  return request({
    url: '/api/patients',
    method: 'get'
  })
}

export function getPatientsByPage(pageNum = 1, pageSize = 10) {
  return request({
    url: '/api/patients/page',
    method: 'get',
    params: {
      pageNum,
      pageSize
    }
  })
}

export function getPatientById(id) {
  return request({
    url: `/api/patients/${id}`,
    method: 'get'
  })
}

export function addPatient(data) {
  return request({
    url: '/api/patients',
    method: 'post',
    data
  })
}

export function updatePatient(id, data) {
  return request({
    url: `/api/patients/${id}`,
    method: 'put',
    data
  })
}

export function deletePatient(id) {
  return request({
    url: `/api/patients/${id}`,
    method: 'delete'
  })
}
